function generateFonts(){

    var text = document.getElementById('fontGeneratorTextArea').value;
    // console.log(text);
    for (var i = 0; i < font_array.length; i ++){

        
        var new_text = text.split('').map(function(c){

            if (i == 1){
                if (c==' '){
                    return c;
                }
                if (c in font_array[i]){
                    return '[\u0332\u0305' + font_array[i][c] + '\u0332\u0305]';
                }
                return '[\u0332\u0305' + c + '\u0332\u0305]';


            }else if(i == 4){
                if (c==' '){
                    return c;
                }
                if (c in font_array[i]){
                    return '\u034F' +font_array[i][c];
                }
                return '\u034F' +c; 


            }else if(i == 6){
                if (c==' '){
                    return c;
                }
                if (c in font_array[i]){
                    return '\u06F0\u06EA\u06EB' + font_array[i][c] + '\u06EA\u06EB\u06F0';
                }
                return '\u06F0\u06EA\u06EB' + c + '\u06EA\u06EB\u06F0';


            }else if(i>=37 && i<=83){
                // console.log(c.toLowerCase());
                if (c.toLowerCase() in font_array[i]){
                    return font_array[i][c.toLowerCase()];
                }
                return c;    


            }else{
                if (c in font_array[i]){
                    return font_array[i][c];
                }
                return c;    

            }
            

        }).join('');
        
        
        document.getElementById('card'+(i+1)).style.display="block";
        document.getElementById('textArea'+(i+1)).value = new_text;

        var textarea = document.getElementById('textArea'+(i+1));
        // console.log('#copyButton'+(i+1));
        textAreaAdjust(textarea);
        document.getElementById("copyButton"+(i+1)).innerHTML = 'Copy';
    } 
}

